import React from "react";


function Home(){
    const logout =()=>{
        window.open("http://localhost:3001/logout","_self")
    }
    return(
        <center>
            <h1>Welcome to Home Page </h1>
            <button onClick={logout}>Logout</button>
        </center>
    )
}

export default Home;
